void mainImage( out vec4 c, in vec2 w )
{
	vec2 p = w/iResolution.x-.3, m=vec2(.1,.05);
    float r = length(p), R = pow(r,.1)-iTime*.01, f = .1+mod(floor((R+.025)/.05), 3.)/9.;
    p = mod(vec2(atan(p.y, p.x)/ 6.283 + sin(iTime*f), R), m)/m;
    c = r*texture( iChannel0, p-.5)*(1.+sin(R*125.66+1.));
}
